import blackink from '../../static/blackink.jpg'
import coffee from '../../static/coffee.jpg'
import photo from '../../static/photo.jpg'
import table from '../../static/table.jpg'
import sketch from '../../static/sketch.jpg'
import unreal from '../../static/unreal.jpg'

class Arts extends Component {
    constructor() {
        super()
        this.state = {
            arts: [blackink, coffee, photo, table, sketch, unreal]
        }
    }
    render() {
        return (
            <div>
                {/*
                    <div className="img">
                        <img src={coffee} alt="art" />
                    </div>
                    <div className="img">
                        <img src={photo} alt="art" />
                    </div>
                    <div className="img">
                        <img src={blackink} alt="art" />
                    </div>
                    <div className="img">
                        <img src={unreal} alt="art" />
                    </div>
                    <div className="img">
                        <img src={sketch} alt="art" />
                    </div>
                    <div className="img">
                        <img src={table} alt="art" />
                    </div>
                */}
                {
                    this.state && this.state.arts.map(art => {
                        return (
                            <div 
                                className="img"
                                style={{ backgroundImage: `url(${art})` }}></div>
                        )
                    })
                }
            </div>
        )
    }
}

export default Arts
